    public function printLetter2($id)
    {
        $user = User::where('id', $id)->first();
        $jamb = JambInfo::where('user_id', $id)->first();

        // Check if records are found
        if (!$user || !$jamb) {
            // Handle the case when records are not found, e.g., return a 404 response.
            abort(404, 'User or JambInfo not found');
        }

        // Pass variables to the Blade view
        $html = view('frontend.letter')->with('user', $user)->with('jamb', $jamb)->render();

        // Create mPDF instance
        $mpdf = new Mpdf();

        // Write HTML content to the PDF
        $mpdf->WriteHTML($html);
        $pdf = '.pdf';
        $filename = $user->application_id . '' . $user->first_name . ' ' . $user->last_name . $pdf;
        // Output the PDF as a response

        $pdfContent = $mpdf->Output('', 'S'); // Output as a string
        return response($pdfContent)
            ->header('Content-Type', 'application/pdf')
            ->header('Content-Disposition', 'inline; filename="' . $filename . '"');
    }

    public function reset(Request $request)
    {
        $t =   User::where('email', $request->email)->first();
        if ($t) {
            $pass = Str::random(8);
            User::where('id', $t->id)->update([
                'password'  => bcrypt($pass)
            ]);
            $t->notify(new ResetDone($pass));
            return back()->with(['msg' => 'A new password has been sent to your e-mail address.']);
        } else {
            return back()->with(['msg' => 'No user found']);
        }
    }
