    /**
     * ","Store a newly created resource in storage.
     *
     * ","@param \Illuminate\Http\Request $request
     * ","@return \Illuminate\Http\JsonResponse
     */
    public function store(Request $request)
    {
        if ($request->password != $request->confirm_password) {
            return response()->json([
                'type' => 0,
                'msg' => 'Password did not matched!'
            ], 404);
        }
        $email = User::where('email', $request->email)->first();
        $phone = User::where('phone', $request->phone_number)->first();
        if ($email) {
            return response()->json([
                'type' => 0,
                'msg' => 'Email already used!'
            ], 404);
        }
        if ($phone) {
            return response()->json([
                'type' => 0,
                'msg' => 'Phone number already used!'
            ], 404);
        }
        $prev = User::latest('created_at')->first();
        if ($prev) {
            $app = (int) substr($prev->application_id, -4) + 1;
        } else {
            $app = "1001";
        }

        $r =  User::create([
            'application_id' => "KUM-APP-" . date("Y") . "-" . $app,
            'first_name' => ucwords(strtolower($request->first_name)),
            'last_name' => ucwords(strtolower($request->last_name)),
            'email' => strtolower($request->email),
            'phone' => $request->phone_number,
            'password' => Hash::make($request->password)
        ]);
        $t = User::where('id', $r->id)->first();
        $t->notify(new RegistationDone($request->all()));
        return response()->json([
            'type' => 1,
            'msg' => 'Registration Successful'
        ], 200);
    }

